description:
Appetite For Destruction

Starring:  Lucy Lee,  Melissa Lauren,  Nyomi Marcela,  Tera Patrick,  Nikki Benz,  Ron Jeremy

By: Tera Vision 
Director: Spyder Jonez

Anal fury unleashed!!! Her ass is craving destruction. Appetites can be insatiable sometimes. Too much is never enough. It is judgment day for the fiery Lucy Lee. With one last chance to defend her life her sexual hunger has gotten the best of her. Where will fate find this decadent vixen? Will her self destruction take her into the afterlife or straight to hell?

